import React, { useState } from 'react';
import axios from 'axios';

function DataEntryForm() {
    const [ime, setIme] = useState('');
    const [prezime, setPrezime] = useState('');
    const [adresa, setAdresa] = useState('');
    const [datumRodjenja, setDatumRodjenja] = useState('');
    const [kontakt, setKontakt] = useState('');
    const [korisnickoIme, setKorisnickoIme] = useState('');
    const [lozinka, setLozinka] = useState('');
    const [uloga, setUloga] = useState('');
    const [message, setMessage] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        const userData = {
            ime,
            prezime,
            adresa,
            datumRodjenja,
            kontakt,
            korisnicko_ime: korisnickoIme,
            lozinka,
            uloga
        };

        const token = localStorage.getItem('authToken');
        if (!token) {
            setMessage('Niste prijavljeni ili je vaša sesija istekla.');
            return;
        }

        axios.post('http://localhost:3000/unos-lovca', userData, {
            headers: {
                Authorization: `Bearer ${token}`
            }
        })
            .then(response => {
                setMessage(`Response: ${response.data.message}`);
            })
            .catch(error => {
                console.error('There was an error!', error);
                setMessage(`Error: ${error.response ? error.response.data.message : 'Server nije dostupan'}`);
            });
    };

    // Styles
    const formStyle = {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        margin: '50px',
        padding: '20px',
        borderRadius: '8px',
        boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
        backgroundColor: '#f7f7f7'
    };

    const inputStyle = {
        margin: '10px 0',
        padding: '10px',
        width: '300px',
        borderRadius: '5px',
        border: '1px solid #ccc'
    };

    const buttonStyle = {
        padding: '10px 20px',
        fontSize: '16px',
        color: 'white',
        backgroundColor: '#007BFF',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer'
    };

    const labelStyle = {
        margin: '10px 0',
        fontWeight: 'bold'
    };

    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#eee' }}>
            <form onSubmit={handleSubmit} style={formStyle}>
                <h1 style={{ color: '#333' }}>Unos lovaca</h1>
                <div>
                    <label style={labelStyle}>Ime:</label>
                    <input
                        type="text"
                        value={ime}
                        onChange={(e) => setIme(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Prezime:</label>
                    <input
                        type="text"
                        value={prezime}
                        onChange={(e) => setPrezime(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Adresa:</label>
                    <input
                        type="text"
                        value={adresa}
                        onChange={(e) => setAdresa(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Datum rođenja:</label>
                    <input
                        type="text"
                        value={datumRodjenja}
                        onChange={(e) => setDatumRodjenja(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Kontakt:</label>
                    <input
                        type="text"
                        value={kontakt}
                        onChange={(e) => setKontakt(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Korisničko ime:</label>
                    <input
                        type="text"
                        value={korisnickoIme}
                        onChange={(e) => setKorisnickoIme(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Lozinka:</label>
                    <input
                        type="text"
                        value={lozinka}
                        onChange={(e) => setLozinka(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Uloga:</label>
                    <input
                        type="text"
                        value={uloga}
                        onChange={(e) => setUloga(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <button type="submit" style={buttonStyle}>Submit</button>
            </form>
            {message && <p>{message}</p>}
        </div>
    );
}

export default DataEntryForm;
